import { Test, TestingModule } from '@nestjs/testing';
import { ShortestPalindromeService } from './shortest-palindrome.service';
import { Input } from './shortest-palindrome';
import { random } from 'faker';
import { lorem as ruLorem } from 'faker/locale/ru';

describe('ShortestPalindromeService', () => {
  let service: ShortestPalindromeService;
  let time: number;

  beforeEach(async () => {
    const module: TestingModule = await Test.createTestingModule({
      providers: [ShortestPalindromeService],
    }).compile();

    service = module.get<ShortestPalindromeService>(ShortestPalindromeService);

    time = performance.now();
  });

  afterEach(() => {
    const resultTime = performance.now() - time;
    expect(resultTime).toBeLessThan(Math.pow(10, 4));
    console.log(resultTime, 'ms');
  });

  it('should be defined', () => {
    expect(service).toBeDefined();
  });

  it('Example 1', () => {
    expect(service.run('aacecaaa')).toEqual('aaacecaaa');
  });

  it('Example 2', () => {
    expect(service.run('abcd')).toEqual('dcbabcd');
  });

  it('Example 3', () => {
    expect(service.run('abbacd')).toEqual('dcabbacd');
  });

  it('Example 4', () => {
    expect(service.run('a')).toEqual('a');
  });

  it('Example 5', () => {
    expect(
      service.run(
        ''
      )
    ).toEqual(
      ''
    );
  });

  it('Constraints', () => {
    const inputs: Input[] = [
      random.alpha({ count: 5 * Math.pow(10, 4) + 1 }),
      ruLorem.word(),
    ];

    inputs.forEach((input) => {
      expect(() => service.run(input)).toThrowError();
    });
  });
});
